import './App.css';
import Header from './components/Header';
import NavBar from './components/NavBar';
import Footer from './components/Footer';
import AddCustomer from './components/AddCustomer';
import { Col, Container, Row } from 'reactstrap';
function App() {
  return (
    <div>
      <Header />
      <Container>
        <Row>
          <Col md={4}> </Col>
          <Col md={8}> </Col>
        </Row>
      </Container>
      <Footer />
    </div>
  );
}

export default App;
